CREATE PROCEDURE dbo.proc_transform_196
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_196
    SET payload = LEFT(payload, 1000) + N'|V4-196|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_196;
END
